  input: TEXT,F3XA,,"In response to your letter, please note that the Committee post
    office box has closed and your letter was not forwarded.  Schedule H2 has been
    corrected to show the correct percentage.  All expenses for the Committee relate
    to fundraising.  There are many itemized expenses shown in the report as well
    as the susequent reports.  Regarding best efforts, the Committee follwos Commission
    guidelines for obtaining the information. The original solicitation contains a
    clear and conspicious request.  If the donor does not provide it, a follow-up
    letter is sent explaining the law and requesting that they return the form filled
    out in the pre-addressed, pre-stamped envelope.  We are still in the process of
    gathering information that will be reported on subsequent reports to the Commission.  Itemized
    expenses for video porduction are related to the production of a video shown at
    the dinner event and not for the benefit of any candidate.  The entertainment
    purpose applies to the cost of providing entertainment at the dinner event.  This
    has traditionally been a famous singer.  In gather best efforts, we are reporting
    to the Commission exactly what the donor provides.  We will follow-up with those
    donros whose occupations do not meet your standard.  Per Commission guidelines,
    the non-federal portion of this report has been filed on paper.  The Committee's
    electronic non-federal file has failed. Please call with questions."
